INSERT INTO termin (_id, dozent, tag, begin, ende, typ, start_datum, end_datum, hinweis, gehoert_zu_gr, gehalten_in)VALUES(1991, 'Langbein', 2, 1730, 1900, 3, '20170410', '20170729', 'Professionelle Softwareentwicklung unter Verwendung von C# und Webtechniken Motivation/Hintergrund In der Arbeitsgruppe des Projektbetreuers werden branchenspezifische Dialog-Konfigurations-Anwendungen und dazugehörige Content-Management-Systeme erarbeitet. In den vergangenen 4 Jahren wurden sowohl auf der Basis von Java als auch von C# mehrere professionelle Anwendungen entwickelt. Die Architekturen richten sich dabei nach bewährten Design Patterns, Best Practices und aktuellen Java- bzw. C#-Technologien. Während des Projektstudiums soll das Back-End einer Java-basierten Web-Anwendung unter Verwendung von Microsoft-Techniken prototypisch auf eine neue technische Basis gestellt werden. - Kennenlernen von Konzepten und Techniken professioneller Software-Entwicklung - Kennenlernen von Aspekten des Zeit- und Qualitätsmanagements in der SW-Entwicklung - Praktische Erfahrungen bei der Koordination von Arbeiten im Team - Praxis im Umgang mit Microsoft-Technologien sowie mit Unterstützungs-Software zur professionellen Produktentwicklung - Erfahrungen bei der Dokumentation und Präsentation der eigenen Arbeit.', 2458, 'WHC624');
